function findRepeatedDnaSequences(s: string): string[] {
    let cacheSet = new Set<string>()
    let answerSet = new Set<string>()
    // 生成所有长度为10的子字符串,
    // 从0~9开始, 分别截取字符串, 验证后续是否重复出现过.
    for (let startPos = 0; startPos <= s.length - 10; startPos++) {
        let targetStr = s.slice(startPos, startPos + 10)
        if (cacheSet.has(targetStr)) {
            // 说明之前出现过
            answerSet.add(targetStr)
        } else {
            cacheSet.add(targetStr)
        }
    }
    return [...answerSet.values()]
}

